### 6. Garbage Collection

React Query uses a time-based collector called `gcTime` to determine when a query's data should be removed from the cache. By default, this is set to 5 minutes.

#### Common Misconception

You might think React Query removes data 5 minutes after it's added to the cache—but that's not true. Here's why:

- Active Queries: Data remains in the cache as long as it's actively used.
- Inactive Queries: Data becomes eligible for garbage collection only when it’s no longer actively used.

#### What Does "Actively Used" Mean?

in 5 minutes:Data will be served from the cache.A background refetch may occur if the data is stale.

```typescript
function useIssues(search) {
  return useQuery({
    queryKey: ["issues", search],
    queryFn: () => fetchIssues(search),
    enabled: search !== "",
    staleTime: 5000, // 5 seconds
    gcTime: 3000 // 3 seconds
  });
}
```

### 7. Polling Data (Scheduled Queries)

When you set a `refetchInterval` (e.g., 3000), React Query automatically triggers the `queryFn` every 3 seconds to fetch new data (like a new UUID). If you manually trigger a refetch (e.g., by clicking a Refetch button), React Query:

1. Updates the data immediately.
2. Resets the 3-second timer for the next automatic refetch. This ensures the interval always aligns with the latest manual fetch.

```typescript
useQuery({
  queryKey: ["repos"],
  queryFn: () => fetchRepos(),
  refetchInterval: 1000 * 60 // 1 minute
});
