### 9. Parallel Queries

You can pass an array of queries to React Query, similar to how `Promise.all` works. React Query will:

- Run all queries in parallel.
- Return an array of results, where the order matches the order of the queries in the array.

This makes it easy to handle multiple queries simultaneously while keeping their results organized.

