One of the best features of the `useQueries` hook is that the array of queries can be dynamic. This allows you to create an arbitrary number of queries based on input. If you want to fetch issues for all repositories in your organization, you can dynamically generate queries based on the list of repositories:

```
function useIssues(repos) {
  return useQueries({
    queries: repos?.map(repo => ({
      queryKey: ["repos", repo.name, "issues"],
      queryFn: async () => {
        const issues = await fetchIssues(repo.name);
        return { repo: repo.name, issues };
      }
    }))
  });
}
