The `useQueries` hook includes a `combine` option, which simplifies merging or transforming the results of multiple queries. Instead of handling this logic manually, you can define a function to process the array of query results.

#### How It Works

- The combine function takes the array of query results as its first argument.
- The value returned by combine will be the final output of useQueries.

```typescript
// Good Practice:
import { useQuery, useQueries } from "@tanstack/react-query";
import { fetchRepos, fetchIssues } from "./api";

function useRepos() {
  return useQuery({
    queryKey: ["repos"],
    queryFn: fetchRepos
  });
}

function useRepos() {
  return useQuery({
    queryKey: ["repos"],
    queryFn: fetchRepos
  });
}

function useIssues(repos) {
  return useQueries({
    queries:
      repos?.map(repo => ({
        queryKey: ["repos", repo.name, "issues"],
        queryFn: async () => {
          const issues = await fetchIssues(repo.name);
          return { repo: repo.name, issues };
        }
      })) ?? [],
    combine: issues => {
      const totalIssues = issues.map(({ data }) => data?.issues.length ?? 0).reduce((a, b) => a + b, 0);

      return { issues, totalIssues };
    }
  });
}

export default function App() {
  const repos = useRepos();
  const { issues, totalIssues } = useIssues(repos.data);

unction App() {
