🔧 Best Practices – Component Design1 - Extract repeated JSX into separate components instead of helper functions.
Defining reusable UI blocks as components (rather than plain functions returning JSX) enables React to optimize rendering better via reconciliation and helps with maintainability, readability, and testing.

### ❌ Helper Function Approach (Not Recommended for JSX)

```js
function renderTag(label: string) {
  return <span className="tag">{label}</span>;
}

export const TagList = () => {
  const tags = ["React", "TypeScript", "Zod"];

  return (
    <div>
      {tags.map(tag => renderTag(tag))}
    </div>
  );
};

```

---

### ✅ Component Approach (Recommended)

```js
const Tag: React.FC<{ label: string }> = ({ label }) => {
  return <span className="tag">{label}</span>;
};

export const TagList = () => {
  const tags = ["React", "TypeScript", "Zod"];

  return (
    <div>
      {tags.map(tag => (
        <Tag key={tag} label={tag} />
      ))}
    </div>
  );
};

