### Queries File:

Queries file contains the [query options](https://tanstack.com/query/latest/docs/framework/react/guides/query-options) that we can pass to useQuery hook. You can think of these options as the necessary configurations for your query. queryOptions has 2 required options: the first one is queryKeyand the second one is queryFn.

The queryFnis the function for this query in the services file. [https://tanstack.com/query/latest/docs/framework/react/guides/query-functions](https://tanstack.com/query/latest/docs/framework/react/guides/query-functions)

n top of it and combine this static key with parameters in queryOptions as we did here for grid key:

```typescript
export const clusterMatrixQueries = {
  clusterMatrixKey: () => [rangePlanQueries.key(), "cluster-matrix"] as const,
  gridKey: () => [...clusterMatrixQueries.clusterMatrixKey(), "grid"] as const,
  grid: (config: ClusterMatrixQueryConfig, pager: IPagerQueryStringParams) =>
    queryOptions({
      queryKey: [...clusterMatrixQueries.gridKey(), config.body, pager?.page, pager?.size, pager],
      queryFn: () => fetchClusterMatrixGrid(config.body, pager),
      enabled: config.isEnabled,
      select: (data: IGridResponse<IClusterMatrixProduct>) => data.rows ?? []
    })
};
```

If you defined a key, it should be named <yourQueryName>Key.

 Structure your queryKeys from most generic to most specific. It can be useful if the query keys follow the order of its service path.

