### Query Hooks File:

We said that use can use your queryOptions directly in useQuery in any component you need. But if you think your query needs a hook (if it takes parameters from somewhere, it needs data from redux state, etc.) you can create a hook for it under <featureName>.query.hooks.ts

```typescript
export const useGetSeasonDetail = () => {
  const seasonIdSelector = useAppSelector(state => state.assortment.rangePlan.newSeasonPanel.selectedSeason?.seasonId);

  return useQuery(seasonQueries.seasonDetail(seasonIdSelector?.toString()));
};
```

In this example our query needs the id of the selected season and it gets the id from redux state. It can be better to create a hook for it if I intend to use this query in multiple components and these components don’t normally obtain the id data.

You can define all of your query hooks under this file.

