    mutationFn: updateClusterMatrix,
    onSuccess: () => {
      dispatch(messagesActions.createMessages("New season product updated successfully!", "success"));
      queryClient.invalidateQueries({
        queryKey: newSeasonQueries.newSeasonKey()
      });
