## Error Handling

### API Error Processing

```typescript
const getTranslationErrorMessages = (error: unknown): string => {
  if (error && typeof error === "object" && "data" in error) {
    const errorResponse = error as IErrorResponse;
    if (Array.isArray(errorResponse.data) && errorResponse.data.length > 0) {
      return errorResponse.data[0].message || "An error occurred";
    }
  }

  if (error && typeof error === "object" && "message" in error) {
    return (error as { message: string }).message;
  }

  return "An unexpected error occurred";
};
```

### User Notifications

All operations provide feedback via Redux `messagesActions`:

- Success: "Changes saved successfully." / "Translations created successfully!"
- Error: Extracted error message from API response
- Warning: Validation failures, unsaved changes warnings

